import React from 'react';
import ReactDOM from 'react-dom';
import './index.css';
// import App from './App';
import {BrowserRouter as Router, Route, Switch} from 'react-router-dom';

import img from "./img/img2.jpg";
import {Navigation} from "./components/Navigation";
import {BookDisplay} from "./components/BookDisplay";
import {Index} from "./views/Index";
import {BookSearch} from "./components/BookSearch";


const books = [
    {img: img, name: "Как делать фуллстек", author: "Пётр Кулагин"},
    {img: img, name: "Ами", author: "Пётр Кулагин"},
    {img: img, name: "Лёха", author: "Пётр Кулагин"},
    {img: img, name: "Петян", author: "Пётр Кулагин"},
    {img: img, name: "Максон", author: "Пётр Кулагин"},
];

ReactDOM.render(
    <Router>
        <Navigation/>
        <Switch>
            <Route path="/search">
                <BookSearch books={books}/>
            </Route>
            <Route path="/all">
                <BookDisplay books={books}/>
            </Route>
            <Route path="/" component={Index}/>
        </Switch>
    </Router>,
    document.getElementById('root')
);
